import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButtons, IonButton, IonIcon, IonMenuButton, IonBackButton } from '@ionic/react';
import React from 'react';
import QRComponent from '../components/QRComponent';
import { happy } from 'ionicons/icons';
import './QRPage.css';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>


        <IonToolbar mode="ios" color="light">
          <IonButtons slot="start">
            <IonMenuButton autoHide={false} color="primary" />
          </IonButtons>
          <IonTitle slot="">أبشر</IonTitle>

          <IonIcon slot="end" src="assets/point-left.svg"></IonIcon>
        </IonToolbar>

      </IonHeader>
      <IonContent>
        <QRComponent />
      </IonContent>
    </IonPage>
  );
};

export default Home;
